import React from 'react';
import PropTypes from 'prop-types';

const RightNav = ({ sideNavToggle }) => { 

    return(
        <div className={ sideNavToggle ? "EditNav" : "Hidden"}>
            {this.props.children}
        </div>
    )
};

RightNav.propTypes = {
    sideNavToggle: PropTypes.bool,
};

export default RightNav;
